  { :title => "---\r\nen: Participation Guidelines\r\n", :content => "---\r\nen: | \r\n    <h1>Better Alamance: Ideas Participation Guidelines</h1>\r\n    <p>The goal of the <a href=\"/ideas\">Better Alamance: Ideas</a> site is to help our local communities develop and share our ideas for improvement. After an idea is submitted, community members have the opportunity to support or oppose the idea, as well as to post comments indicating the \"pros\" and \"cons\" of the idea. Following these guidelines will help ensure a productive experience:\r\n    </p><ul>\r\n    <li><strong>Ideas should be actionable by the local community.</strong></li>\r\n    <li><strong>Be positive, and write to engage your neighbors.</strong></li> \r\n    <li><strong>Points should address the substance of ideas.</strong></li>\r\n    <li><strong>Spam, advertising, and commercial content is not appropriate.</strong></li>\r\n    <li><strong>Participants may choose to post ideas anonymously (by using the voicemail number) or participated using a pseudonym (username) -- use of real names is encouraged, but not required, on the Ideas site.</strong></li>\r\n    </ul>\r\n    <p>To ensure participation is fair and transparent, the following rules apply to general participation. Violation may result in account termination.\r\n    </p><ul> \r\n    <li><strong>Only one user account may be created and used by a participant.</strong></li>\r\n    <li><strong>The email address associated with the account must be active.</strong></li>\r\n    <li><strong>Malicious, misleading, or threatending content will not be tolerated.</strong></li>\r\n    <li><strong>Personal information, such as addresses or phone numbers, may not be posted.</strong></li>\r\n    </ul>  \r\n    <p>For more information about how any personal information you provide might be used, please see our friendly <a href=\"/privacy\">Privacy Policy</a>.</p>\r\n", :created_at => "2014-04-16 18:05:55", :updated_at => "2014-04-16 18:23:55", :weight => 0, :sub_instance_id => 1, :name => "", :hide_from_menu => false, :hide_from_menu_unless_admin => false }
